import {
  Route,
  RouterProvider,
  createBrowserRouter,
  createRoutesFromElements,
} from "react-router-dom";
import Home, { dashboardLoader } from "./pages/Home";
import Login, { loginLoader } from "./pages/Login";
import Register, { registerLoader } from "./pages/Register";
import RootLayout from "./layouts/RootLayout";
import Companies from "./pages/Companies";
import DashboardLayout from "./layouts/DashboardLayout";
import NotFound from "./components/ui/NotFound";
import { Navigate } from "react-router-dom";

import { APP_ROUTES } from "./utils/constants";
import ProtectedRoute from "./components/ui/ProtectedRoute";

function App() {
  const router = createBrowserRouter(
    createRoutesFromElements(
      <Route path='/' element={<RootLayout />}>
        <Route index element={<Navigate to={APP_ROUTES.DASHBOARD} />} />

        <Route
          path={APP_ROUTES.LOGIN}
          element={<Login />}
          loader={loginLoader}
        />
        <Route
          path={APP_ROUTES.REGISTER}
          element={<Register />}
          loader={registerLoader}
        />

        <Route element={<ProtectedRoute role='user' />}>
          <Route index element={<Navigate to={APP_ROUTES.DASHBOARD} />} />

          <Route path={APP_ROUTES.DASHBOARD} element={<DashboardLayout />}>
            <Route index element={<Home />} loader={dashboardLoader} />
          </Route>
        </Route>

        <Route path='*' element={<NotFound />} />
      </Route>
    )
  );

  return <RouterProvider router={router}></RouterProvider>;
}

export default App;
